import React from "react";

function Loginbar(props) {
    const {isLoggedIn, onClickLogin, onClickLogout} = props;

    return (
        <>
            {isLoggedIn ? (
                <button onClick={onClickLogout}>로그아웃</button>
            ) : (
                <button onClick={onClickLogin}>로그인</button>
            )
        }
        </>
    )
}
export default Loginbar;
